{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/microsoft/azure-gradle-plugins/issues/131', 'repository_url': 'https://api.github.com/repos/microsoft/azure-gradle-plugins', 'labels_url': 'https://api.github.com/repos/microsoft/azure-gradle-plugins/issues/131/labels{/name}', 'comments_url': 'https://api.github.com/repos/microsoft/azure-gradle-plugins/issues/131/comments', 'events_url': 'https://api.github.com/repos/microsoft/azure-gradle-plugins/issues/131/events', 'html_url': 'https://github.com/microsoft/azure-gradle-plugins/pull/131', 'id': 1143176608, 'node_id': 'PR_kwDODjUufM4zFvKz', 'number': 131, 'title': 'Add support for multiple archives', 'user': {'login': 'melix', 'id': 316357, 'node_id': 'MDQ6VXNlcjMxNjM1Nw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/316357?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/melix', 'html_url': 'https://github.com/melix', 'followers_url': 'https://api.github.com/users/melix/followers', 'following_url': 'https://api.github.com/users/melix/following{/other_user}', 'gists_url': 'https://api.github.com/users/melix/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/melix/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/melix/subscriptions', 'organizations_url': 'https://api.github.com/users/melix/orgs', 'repos_url': 'https://api.github.com/users/melix/repos', 'events_url': 'https://api.github.com/users/melix/events{/privacy}', 'received_events_url': 'https://api.github.com/users/melix/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 3, 'created_at': '2022-02-18T14:37:27Z', 'updated_at': '2022-04-20T13:08:09Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'draft': False, 'pull_request': {'url': 'https://api.github.com/repos/microsoft/azure-gradle-plugins/pulls/131', 'html_url': 'https://github.com/microsoft/azure-gradle-plugins/pull/131', 'diff_url': 'https://github.com/microsoft/azure-gradle-plugins/pull/131.diff', 'patch_url': 'https://github.com/microsoft/azure-gradle-plugins/pull/131.patch', 'merged_at': None}, 'body': '## Context

[Micronaut AOT](https://medium.com/graalvm/introducing-micronaut-aot-build-time-optimizations-for-your-micronaut-applications-68b8f1302c5) is a project which optimizes a Micronaut application, or functions, for a particular deployment environment.
In that context, we need to add support for optimizing Azure functions (we already support deploying optimized lambdas and Oracle Functions).
At the moment, Micronaut relies on the Azure functions plugin to provide the required support for deploying Azure functions.
The problem is that this plugin hardcodes a number of things, making it impossible to deploy AOT optimized binaries.

## Supporting multiple archives

The goal of this PR is not to fix all Gradle tasks (currently they are not declaring any input or outputs, which makes them not very suitable for up-to-date checking or any or the advantages of using Gradle).
The goal of this PR is to provide the _minimal set of features_ which would let Micronaut AOT deploy optimized Azure functions.
For this purpose, the plugin has been refactored, in order to properly declare the _runtime classpath_ of functions, as well as their _jars_. 
That is to say, instead of the plugin trying to introspect the project at execution time and figure out what jar to use, it uses the proper Gradle model to do this.

In addition, there is now a container which lets the user (or plugin authors like us) create new "binaries" which use different jars:

```gradle
azureBinaries {
     aot {
        resourceGroup = "java-functions-group"
        appName = "micronautguide-aot"
        pricingTier = "Consumption"
        region = "westus"
        runtime {
            os = "linux"
        }
        localDebug = "transport=dt_socket,server=y,suspend=n,address=5005"
    }
}
```

The `main` binary is mapped to the current `azurefunctions` extension, in order to preserve backwards compatibility.
The advantage of doing so is that these new binaries can be registered by a plugin like the Micronaut AOT plugin, which would wire the tasks to use a different jar, that is to say here the _AOT optimized jar_ (simplified code for the example):

```gradle
tasks.withType(AbstractAzureTask).configureEach {
    if (it.name.contains('Aot')) {
        // Azure tasks which contain "AOT" are created automatically by declaring the binary
        // and now we can configure them so that they use the optimized jar instead of the "main" jar
        archiveFile.set(tasks.named("optimizedJitJar").flatMap { it.archiveFile })
    }
}
```

Of course ideally the extension itself should carry the information about the classpath and archive to use, but this can be implemented later. As I said, currently the tasks are far from being "stateless functions" in the sense that they don't properly declare their inputs. This, however, would unblock us from implementing this feature.

Thanks!
